import React from "react";
const Container = props => {

  return (
    <div>
      <h1>{props.title}</h1>
      <button onClick={props.handleClick}>click</button>
      <div>
        <input type="text" onChange={props.handleChange} />
      </div>
    </div>
  );
};

export default Container;
